import{_ as a,o as i,c as e,X as n}from"./chunks/framework.37cee08b.js";const v=JSON.parse('{"title":"Instalasi FiveM","titleTemplate":":title | Cara Bermain","description":"Instalasi FiveM.","frontmatter":{"aside":true,"title":"Instalasi FiveM","description":"Instalasi FiveM.","titleTemplate":":title | Cara Bermain"},"headers":[],"relativePath":"logical/how-to-play/fivem-installation.md","filePath":"logical/how-to-play/fivem-installation.md","lastUpdated":1692525345000}'),t={name:"logical/how-to-play/fivem-installation.md"},l=n('<h1 id="instalasi-fivem" tabindex="-1">Instalasi FiveM <a class="header-anchor" href="#instalasi-fivem" aria-label="Permalink to &quot;Instalasi FiveM&quot;">​</a></h1><p>Untuk dapat bermain FiveM kamu harus memiliki games GTA V Original.</p><h2 id="unduh-dan-instal-fivem" tabindex="-1">Unduh dan Instal FiveM <a class="header-anchor" href="#unduh-dan-instal-fivem" aria-label="Permalink to &quot;Unduh dan Instal FiveM&quot;">​</a></h2><p>FiveM adalah modifikasi permainan yang memungkinkan Anda mengakses server roleplay di GTA V. Untuk mengunduh dan menginstal FiveM, ikuti langkah-langkah berikut:</p><ol><li>Buka browser web dan kunjungi situs web FiveM di <a href="https://fivem.net" target="_blank" rel="noreferrer">https://fivem.net</a>.</li><li>Klik tombol &quot;Unduh Client&quot; di halaman beranda.</li><li>Tunggu proses unduhan selesai.</li><li>Setelah selesai, buka file instalasi FiveM yang baru diunduh.</li><li>Ikuti petunjuk pada layar untuk menginstal FiveM di komputer Anda.</li><li>Tunggu hingga proses instalasi selesai.</li></ol><h2 id="membuat-akun-fivem" tabindex="-1">Membuat Akun FiveM <a class="header-anchor" href="#membuat-akun-fivem" aria-label="Permalink to &quot;Membuat Akun FiveM&quot;">​</a></h2><p>Sebelum Anda dapat bergabung dengan server GTA V Roleplay, Anda perlu membuat akun FiveM. Berikut adalah langkah-langkahnya:</p><ol><li>Buka FiveM setelah selesai diinstal.</li><li>Klik tombol &quot;Buat Akun&quot; di jendela masuk.</li><li>Isi formulir pendaftaran dengan informasi yang diperlukan, seperti nama pengguna, alamat email, dan kata sandi.</li><li>Setelah selesai, klik tombol &quot;Daftar&quot; atau &quot;Sign Up&quot;.</li><li>Verifikasi akun Anda melalui tautan yang dikirimkan melalui email.</li><li>Setelah akun Anda diverifikasi, buka kembali FiveM.</li></ol>',8),s=[l];function u(r,o,d,m,k,h){return i(),e("div",null,s)}const g=a(t,[["render",u]]);export{v as __pageData,g as default};
